    body { margin: 0; padding: 0; }

    }
    
    /* Clase para plegar */
    .sidebar-plegada { transform: translateX(-100%); }
    
    /* Bot√≥n de plegado */
    #toggle-sidebar {
        position: fixed; top: 10px; left: 330px; z-index: 2000;
        background: #1E5F91; color: white; border: 2px solid #FFD700;

    .checkbox-maestro { transform: scale(1.2); cursor: pointer; }
    .flecha { font-size: 10px; transition: transform 0.3s; margin-right: 5px; }
    .colapsado .flecha { transform: rotate(-90deg); }
    .grupo-contenido { padding-left: 10px; margin-top: 5px; }
    .grupo-contenido.oculto { display: none; }
    .leaflet-control-layers-overlays label { color: white !important; margin-bottom: 3px !important; display: block !important; cursor: pointer; font-size: 11px !important; }
    .folium-map { position: absolute !important; left: 320px !important; width: calc(100% - 320px) !important; height: 100vh !important; transition: left 0.3s, width 0.3s; }

    <div id="toggle-sidebar" onclick="toggleSidebar()">Plegar Men√∫</div>
    
<script>
    function toggleSidebar() {
        var sidebar = document.querySelector('.leaflet-control-layers');
        var boton = document.getElementById('toggle-sidebar');
        var mapaDiv = document.querySelector('.folium-map');
        
        sidebar.classList.toggle('sidebar-plegada');
        boton.classList.toggle('boton-plegado');
        mapaDiv.classList.toggle('map-full');
        
        boton.innerText = sidebar.classList.contains('sidebar-plegada') ? 'Ver Men√∫' : 'Plegar Men√∫';
    }

    document.addEventListener("DOMContentLoaded", function() {
        var layersControl = document.querySelector('.leaflet-control-layers-overlays');
        var labels = Array.from(layersControl.querySelectorAll('label'));
        
        layersControl.innerHTML = '<div style="text-align: center; border-bottom: 2px solid white; margin-bottom: 20px; padding-bottom:10px;">' +
                                  '<h3 style="margin:0; font-size:16px;">Modalidad Motochorros</h3>' +
                                  '<h4 style="margin:5px 0 0 0; font-size:12px; opacity:0.8;">MDP - SSRAII</h4></div>';

        function crearCategoria(filtros, nombreVisible, esDesplegable) {
            var contenedor = document.createElement('div');
            contenedor.className = 'seccion-contenedor' + (esDesplegable ? ' colapsado' : '');
            var header = document.createElement('div');
            header.className = 'seccion-header';
            var chkPadre = document.createElement('input');
            chkPadre.type = 'checkbox';
            chkPadre.className = 'checkbox-maestro';
            var titulo = document.createElement('div');
            titulo.className = 'seccion-titulo-texto';
            titulo.innerText = nombreVisible;
            var flecha = document.createElement('span');
            flecha.className = 'flecha';
            flecha.innerText = '‚ñº';

            header.appendChild(chkPadre);
            header.appendChild(titulo);
            if(esDesplegable) header.appendChild(flecha);
            
            var cuerpo = document.createElement('div');
            cuerpo.className = 'grupo-contenido' + (esDesplegable ? ' oculto' : '');
            
            var items = labels.filter(l => filtros.some(f => l.innerText.includes(f)));
            items.forEach(l => cuerpo.appendChild(l));

            if(items.length > 0) {
                layersControl.appendChild(contenedor);
                contenedor.appendChild(header);
                contenedor.appendChild(cuerpo);

                titulo.onclick = function() {
                    if(esDesplegable) {
                        cuerpo.classList.toggle('oculto');
                        contenedor.classList.toggle('colapsado');
                    }
                };
                
                chkPadre.onchange = function() {
                    var estado = this.checked;
                    cuerpo.querySelectorAll('input').forEach(c => { if(c.checked !== estado) c.click(); });
                };
            }
        }

        crearCategoria(["üî¥"], "Desde 20-12-2025 al 05-01-26", true);
        crearCategoria(["üîµ"], "Desde el 10-01-26 a la fecha", true);
        crearCategoria(["üü¢"], "Delitos por 911", true);
        crearCategoria(["üî≤", "üõ°Ô∏è"], "Despliegue de Recursos", false);
        crearCategoria(["üüß"], "Shapefiles / An√°lisis", false);
        crearCategoria(["‚ö™"], "Comparativa", true);
    });
</script>

e resta solo uno. Tales circunstancias, se procede a realizar se√±ales de luces, balizas y sirena a los fines de que estos masculinos detengan su marcha, y estos, al notar la presenciad del personal policial hacen caso omiso y emprenden fuga a gran velocidad. Acto seguido, se da aviso por capa operativa 911 de lo sucedido, y en las calles Genova y Ciudad de Dolores de este medio, mas precisamente tirada sobre la calle, se realiza el hallazgo de una de las motocicletas, la cual resulta ser de marca Honda, modelo XR-250, color roja y blanca, con dominios colocados A079CAJ reconociendola como la que previamente se fugo del personal policial. Con respecto a la otra motocicleta, al momento del arribo del suscripto ya no se encontraba en el lugar, al igual que los masculinos, quienes emprendieron fuga en el otro motovehiculo. En ese momento, el Oficial de Policia Medina Enzo Rodrigo, legajo 428.996 y Oficial de Policia Leandro Bonazzola, legajo 429.110 a bordo de vehiculo ro 32.820, numerarios de la Direccion de Investigaciones de Delitos Contra la Propiedad Automotor, dependiente de la Superintendencia de Investigaciones de Delitos Complejos y Crimen Organizado de la Policia de la Provincia de Buenos Aires y quienes se encuentran abocados en el marco del OPERATIVO DE SOL A SOL 2025/2026, Orden de Servicio C.O.P. Nro. 00-064/25 al escuchar la capa operativa momentos previos, logran avistar una motocicleta, con tres masculinos a bordo, los cuales son interceptados en las calles Castex entre Napoles y Puan de este medio, notando que el motovehiculo resulta de marca GILERA modelo Smash sin dominios colocados. Una vez eso, se hace presente quien suscribe, reconociendo a los masculinos que se fugaron momentos previos. En ese momento se procede a identificar a los masculinos interceptados: 1) PAREDES ALEXIS EZEQUIEL, INSTRUIDO, DNI. 50280779, NACIDO EL DIA 10/05/2010 EN MAR DEL PLATA, DE 15 A√ëOS DE EDAD, DOMICILIADO EN CALLE CAMUZO 1662 BARRIO FORTUNATO DE LA PLAZA, HIJO DE SA                 var html_5ecf1b99c0465ae7a6670a5fcc8f31da = $(`<div id="html_5ecf1b99c0465ae7a6670a5fcc8f31da" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:47:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>VERTIZ 7400</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO POR EL USO DE ARMA DE FUERGO </td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En la ciudad de Mar del Plata, partido de Gral. Pueyrredon, provincia de Buenos Aires, a los 23 dias del mes de enero del a√±o 2026, siendo las la suscripta Teniente Rampi, secundada en la oportunidad por el Sargento Acosta Victor, en circunstancias que se hallaban en prevencion de falta e ilicitos en general, mientras circulaban por calle Guanahani y Av. Polonia, un transeunte a bordo de un vehiculo los intercepta y les hace se√±as para que se detengan. Una vez entrevistado el masculino, el mismo refiere que le habian sustraido la moto en el barrio ‚ÄúLa Herradura‚Äù y que sabia que estaba en el pasillo por Pehuajo entre Vertiz y San Salvador, tratandose de una Gilera 110cc roja (ID 15754149). La Teniente Rampi realiza un recorrido por la zona, observando en el pasillo mencionado ut supra que se hallaban dos motovehiculos, uno de ellos de la misma caracteristica que el denunciado por el transeunte. Atento a ello, es que la Teniente Rampi solicita colaboracion en el lugar, arribando para ello el movil IO 29397, Sgto. Pe√±a, IO29601, Sgto. Rejas Braian y Oficial Mu√±oz Lucas, y movil RO 30174 a cargo de la Subteniente Jurado Magali y Oficial de Policia Veron Noelia, quienes realizan cerrojo por calle Vertiz y por calle San Salvador, mientras la Teniente Rampi junto al Sgto. Acosta ingresan por el pasillo donde se hallaban las motos y dos sujetos masculinos, quienes al percatarse de la presencia policial emprenden fugan ingresando a un domicilio del asentamiento ubicado en el lugar, en este lapso el sujeto individualizado por vestir camisa color verde y blanca, quien se descarta en la entrada del domicilio, un morral color azul. Se continua su persecucion hasta logra la aprehension de ambos sujetos masculinos. Que, al tratarse el lugar de un asentamiento donde los vecinos resultan ser reticentes con el personal policial, y de recibir agresiones a traves de que arrojaban piedrazos entre otros elementos, que entorpecian la labor policial, se procede a cargar los dos motovehiculos, el morral y a introducir a ambos sujetos en el interior del movil policial, trasladando todo ello a la dependencia policial que se encuentra emplazada a 400mts del lugar a fines resguardar la integridad de las personas demoradas y las del personal policial. Una vez en los asientos de Comisaria Decimosexta, se requiere de la presencia de un testigo de actuacion a quien impuesto por las penas con que la ley castiga el falso testimonio presta juramento de ley a producirse con veracidad en todos sus dichos y en todo lo que le fuere preguntado, recayendo tal responsabilidad sobre el ciudadano VILLALBA GUILLERMO HORACIO, argentino, de 45 a√±os de edad, soltero, de ocupacion cocinero, titular del DNI nro. 28.453.876, nacido el 05/11/1980, en Mar del Plata, domiciliado en calle Fitte nro. 2185, de este medio, abonado 223 5802067, delante de quien se procede a realizar un palpado sobre las prendas de ambos sujetos, no hallando elementos de interes, que pudieran atentar contra la integridad fisica propia y de terceros, arrojando resultado negativo, seguidamente se procede a dar lectura de derechos y garantias que por ley lo asisten manifestando ambos masculinos si, haberlos comprendido. Se continua con el secuestro del morral, del cual se  exhibe lo que hay en el interior, tratandose de (66) sesenta y seis envoltorios de nylon color blanco, que en su interior contiene una sustancia blanca, polvorienta, similar al clorhidrato de cocaina. Dinero en efectivo ciento cincuenta mil doscientos cincuenta pesos. Seguidamente, consultan ambos motovehiculos por sistema informatico, a traves del numero de motor 5DH1P50FMH2D5850928, el cual cursado por sistema informatico corresponde a una honda 110cc que posee ‚ÄúPedido de secuestro activo‚Äù con fecha 11/12/2025, de comisaria 13ra., como asi tambien el motovehiculo Gilera Smash color roja y negra con dominio colocado A277JHS, la cual arroja ‚ÄúAdelanto de secuestro activo‚Äù de fecha actual, todo lo mencionado resulta legalmente secuestrado bajo atenta mirada del testigo. Controlada la situacion se procede a identificar a los sujetos, manifestando el individualizado por descartarse el morral azul como: Difino Roman Agustin, argentino, instruido, de 18 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.216.376, nacido el 10/01/2008, de este medio, domiciliado en calle (Vertiz y las vias, pasillo), hijo de Difino Eduardo Javier (v) y Corvalan Sandra Gisel (v), quien resulta ser de contextura fisica delgada, tez trigue√±a, de cabello casta√±o oscuro corto, de 1.80mts de altura, quien viste camiseta a rayas verde y blanco, pantalon negro y zapatillas negras. Mientras el segundo masculino, manifesto ser y llamarse: Bonaventura Luciano Iasaias, argentino, instruido, con fecha de nacimiento 05/10/2006, que no memorizaba su numero de documento de identidad. Seguidamente, en este acto se hace presente una ciudadana manifestando ser familiar del sujeto ‚Äúmenor‚Äù, quien se identifico como Alfonso Silvia Esperanza, aportando un Documento Nacional de Identidad, el cual poseia la foto de un menor de edad, no logrando distinguir con la fotografia si se trataba realmente del encausado que manifestaba ser menor de edad. Al indicarle al masculino que refiriera su fecha de nacimiento nuevamente para cotejar si el DNI se trataba del suyo, este responde como fecha de nacimiento 03/03/2009, dando cuenta que mentia los datos filiatorios. Siendo que a la femenina se le indica que se retire ya que se encontraba acompa√±ada de tres menores, de edades infantes. Al sentirse acorralado por la situacion, el mismo finalmente, refiere ser y llamarse: MONTALIVET LAUTARO EEQUIEL, argentino, instruido, de 17 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.986.197, nacido el 21/10/2008, en Mar del Plata, domiciliado en calle Vertiz, nro. 7631, de este medio, hijo de Montalivet Cesar Ezequiel (V) y Bonaventura Nelida (V), quien resulta ser de contextura fisica delgada, de tez morena, de cabello oscuro corto, de 1.60 mts. de altura, quien viste remera roja, y short de futbol de boca color azul y amarillo, lleva puesto en los pies ojotas blancas. Tras ser consultado por sistema informatico posee CAPTURA ACTIVA, solicitada por el Juzgado del Joven n¬∞1, con fecha 05/09/2025, bajo IPP 020078/25-00. Una vez corroborado que el encausado resulta ser menor de edad, se lo notifica de la formacion de causa asistido por un adulto mayo, la ciudadana Palacios Evelyn Elizabeth, argentina, instruida, de 28 a√±os de edad, soltera, embasadora, titular del DNI nro. 45.131.277, nacida el 16/12/1997, en Mar del Plata, domiciliada en calle Camusso nro. 1699 de este medio, enterandoselo del contenido del ARTICULO 36 DE LA LEY 13.634 cuyo texto reza ‚ÄúEl ni√±o sujeto a proceso penal gozara de todos los derechos y garantias reconocidos a los mayores y en especial tendra derecho a: 1) Ser informado de los motivos de la investigacion y de la autoridad responsable de la misma, del derecho a no declarar contra si mismo y a solicitar la presencia inmediata de sus padres, tutores, responsables y su defensor: 2) No ser interrogado por autoridades policiales, militares, civiles o administrativas: 3) Recibir informacion clara y precisa de todas las autoridades intervinientes del fuero, sobre el significado de cada una de las actuaciones procesales que se desarrollan en su presencia, asi como del contenido y de las razones, incluso etico y sociales de las decisiones, de tal forma que el procedimiento cumpla su funcion educativa: 4) Que la privacion de la libertad sea solo una medida de ultimo recurso y que sea aplicada por el periodo mas breve posible, debiendo cumplirse en instituciones especificas para ni√±os, separadas de las de adulto, a cargo del personal especialmente capacitado, teniendo en cuenta las necesidades de su edad: 5) Comunicarse personalmente con la autoridad judicial, recibir visitas, e intercambiar correspondencia con su familia, al estudio y a la recreacion: 6) Que no se registren antecedentes policiales que perjudiquen su dignidad: 7) Que las decisiones sobre las medidas cautelares salidas alternativas al proceso, y requisitoria de elevacion a juicio, bajo pena de nulidad, se dicten en audiencia oral en su presencia, la de su defensor, acusador y demas intervinientes, conforme a los principios de continuidad, y mediacion, contradiccion y concentracion. Asimismo, se lo notifica del art. 12 de la Convencion del Ni√±o del derecho de ser escuchado. Seguidamente y conforme lo dispone el Art. 60 del CPPBA, se le hace saber que desde el primer momento del inicio de las actuaciones goza de las siguientes garantias minimas: 1) Ser informado sin demora en un idioma que comprenda y en forma detallada de la naturaleza y la causa de los cargos que se le imputan: 2) A comunicarse libremente con un letrado de su eleccion, y que le asiste el derecho de ser asistido y comunicado por el Defensor Oficial: 3) Que no esta obligado a declarar contra si mismo ni a confesarse culpable: 4) Los derechos que le asisten con relacion al responsable civil del hecho por el que se lo imputa si lo hubiere, y tambien respecto del asegurador, en caso de existir contrato, como asi mismo los derechos que lo asisten respecto de requerir al asegurador que asuma su defensa penal. Por ultimo se le notifica del articulo 1 de la LEY 22278, el cual reza: no es punible el menor que no haya cumplido dieciseis a√±os de edad. Tampoco lo es el que no haya cumplido dieciocho a√±os, respecto de delitos de accion privada o reprimidos con pena privativa de la libertad que no exceda de dos a√±os, con multa o con inhabilitacion. Si existiere imputacion contra alguno de ellos la autoridad judicial lo dispondra provisionalmente, procedera a la comprobacion del delito, tomara conocimiento directo del menor, de sus padres, tutor o guardador y ordenara los informes y peritaciones conducentes al estudio de su personalidad y de las condiciones familiares y ambientales en que se encuentre. En caso necesario pondra al menor en lugar adecuado para su mejor estudio durante el tiempo  indispensable. Si de los estudios realizados resultare que el menor se halla abandonado, falto de asistencia, en peligro material o moral, o presenta problemas de conducta, el juez dispondra definitivamente del mismo por auto fundado, previa audiencia de los padres, tutor o guardador. El movil 30504, a cargo de la Teniente Rampi, se dirige junto al testigo de actuacion a realizar a la sede de ‚Äúdrogas‚Äù el reactivo correspondiente a cargo de OSI Lescano Dario, corroborando que al tomar azarosamente el testigo una muestra del secuestro de la sustancia blanca, polvorienta, misma arroja resultado positivo para clorhidrato de cocaina. Al colocar en la balanza la totalidad de envoltorios, misma arroja un pesaje de 11.35gr. La Sargento Espinosa mantiene comunicacion con la Comisaria Duodecima, a fines consultar si habian recibido denuncia de un motovehiculo Gilera, 110cc, confirmando la existencia de la IPP 003635-26/00, efectuada por el ciudadano Montalivet Cesar Ezequiel, argentino, instruido, de 58 a√±os de edad, casado, empleado, titular del DNI nro. 18.674.850, nacido el 06/11/1967, domiciliado en calle Rivadavia nro. 12720, abonado 2236694848, quien manifiesta que se encontraba en su domicilio cuando advierte el ingreso al patio de su casa un motovehiculo 110cc con dos masculinos a bordo, mientras que en la vereda queda otro motovehiculo de 110cc abordado por dos masculinos mas, seguido observa ingresar a su nieto Montalivet Lautaro manipulando un arma de fuego, desconociendo tipo y calibre, con la cual apunta al interior de la vivienda donde se encontraba con su familia. Sustrayendole su motovehiculo marca Gilera modelo Smash 110, modelo 2025, motor nro. AD1P52FMHR0027535, NRO. CHASI 8CXSMASHSRNS70130, color rojo con detalles en negro. A esta altura, habiendo identificado correctamente a los causantes, y ante la intervencion de un menor de edad en el hecho, es que el jefe de turno, Comisario Ortiz Flavio, mantiene comunicacion con el FRPJ 3, a cargo del Sr. Agente Fiscal Dr. Walter Martinez Soto, quien interiorizado de los pormenores dispone se notifique de la formacion de causa por ROBO CALIFICADO POR EL USO DE ARMA DE FUEGO, se notifique a ambos causantes del articulo 60 CPP, se realicen diligencias de rigor, se traslade al menor al CEA, y al mayor a la unidad penal 44. Se remitan actuaciones escaneadas via email. Presentacion del menor a las 08:00hs en el FRPJ. Siendo las 02:00hs, la Sargento Espinosa Anahi, intenta mantener comunicacion con el abonado 2234225537, Juzgado de garantias del Joven 1, a cargo del Dr. Saumell, no logrando obtener respuesta. Siendo las 02:01hs se intenta entablar comunicacion con la Defensoria del Joven 4, De La Plaza, no logrando obtener respuesta. Siendo las 03:28hs, se logra mantener comunicacion con la Defensoria 4, Dr. De La Plaza, quien se interioriza de los pormenores en virtud al menor Montalivet. Cabe destacar que siendo las 02:20hs se traslada al menor Montalivet en el movil 30498 a cargo del Oficial Principal Silva, al CEA, por asi haberlo dispuesto el Sr. Agente Fiscal Dr. Martinez Soto, no siendo recibido por carecer de informe medico. Que, por la franja horaria, se carece de facultativo medico en sede de cuerpo medico de policia. Se traslada al menor al HIGA, informando que no habia medico hasta las 08:00hs. Se comienza a comunicar a los Centros de Primeros Auxilios, a fines corroborar si poseen guardia, encomendando un movil policial, quien entrevistado en el CAPS N¬∞ 2 de calle 12 de Octubre nro. 4445, quienes refieren que acerquemos al menor que realizarian una constancia medica de atencion. Misma es emitida por el Dr. Sandoval Jorgelina, 05:10hs. Se deja constancia que por la hora en la que se logra culminar la diligencia del examen medico legal, el menor Montalivet permanece en el movil RO 30498 a cargo del Oficial Principal Silva, para ser trasladado en breve a la fiscalia requerida. No siendo para mas el acto se da por finalizada la presente la cual es leida, ratificada, y firmada el pie por sus intervinientes para legal constancia. -"                 </div>             </div>         </div>         </div>`)[0];

                var html_150d67c2526cefc548de73a9e89a78d9 = $(`<div id="html_150d67c2526cefc548de73a9e89a78d9" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>01:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>DELLA PAOLERA  2325</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Fecha, siendo las 09:45hs., denuncia que resulta ser ‚Äúpropietario‚Äù de vehiculo marca ‚ÄúCorven‚Äù, modelo ‚ÄúEnergy 110 by corven‚Äù, dominio sin asignar‚Äù, color ‚ÄúBlaca‚Äù, chasis N¬∞ ‚Äú 8CVXCH2G4SA504615‚Äù, motor N¬∞ ‚ÄúCVSA20A214535‚Äù a√±o de fabricacion 2026, no posee patente ya que el mismo la retira de la concesionaria el dia 10 de enero aproximadamente no recordando fecha exacta en este momento, kilometros realizado 140Km, tanque de combustible 1‚ÅÑ2 aproximadamente. Que en el dia de la fecha, a las 01:20horas aproximadas, dirige desde su trabajo en el complejo parque industrial, hacia su vivienda en calle Avenida Della Paolera 2325, al llegar a calle Avenida Della Paolera llegando a la Avenida Constitucion sobre el lado de la izquierda aparece un motovehiculo el cual no puede dar descripciones con dos masculinos, ellos se le ponen a la par e intentan tirarlo del rodado no lograndolo, en ese instante aparece un segundo moto vehiculo, con dos masculinos los cuales logran desestabilizar al deponente, y hacen que el mismo pierda el equilibrio, una ves que el masculino esta en el piso, uno de los cuatro masculino se acerca al masculino para reducirlo, y en ese momento mientras el deponente se encontraba reducido un segundo masculino toma su moto vehiculo y se dan a la fuga en el y en los otros dos rodados por calle Della Paolera en direccion a Calle Monse√±or Zabala perdiendolos de vista, ya que el lugar se encuentra muy oscuro Preguntado si recuerda alguna caracteristica en particular del motovehiculo, refiere: refiere que estaba de fabrica, sin ningun tipo de da√±o ni cambio realizado. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: que le parece que eran personas jovenes, que no puede recordar vestimentas, solo que no tenian casco colocado si gorras pero que no recuerdas rostros. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: NO, que no pudo ver sus rostros. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: no, que hablaban agresivo pero no escucho nada diferente en su forma de hablar, que por como hablaban debian tener entre 18 y 25a√±os. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, que ellos no hablaron entre si. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: que supone que en calle Della Paolera y consitucion tiene camaras pero que el de igual forma no llego a la avenida. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, dice que posee en este momento solo un juego de llave el cual aporta en este acto, el segundo juego se lo llevaron al momento del robo. Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 140Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que 1/2 tanque aproximado de combustible Nafta. Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que no posee ningun contrato de rastreador. Examinado si posee seguro y que tipo de cobertura posee, responde  que tiene su vehiculo asegurado por Triunfo poliza N¬∞ 481 3.037.838, con cobertura todo riesgo. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que no. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde que desconoce ya que era tarde y los pocos autos que pasaron ninguno paro auxiliarlo. Interrogado si su vehiculo poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, responde que al momento no lo llevo al talle. Examinado si poseia elementos en el interior de su vehiculo que desea aclarar, responde que no tenia nada en el rodado. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que se acerco directamente a la dependencia. Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde que no.. Preguntado si los masculinos tenian arma de fuego, refiere que no vio ninguna, solo que amedrentaban de tener. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No."                 </div>             </div>         </div>         </div>`)[0];

Teniente Rampi realiza un recorrido por la zona, observando en el pasillo mencionado ut supra que se hallaban dos motovehiculos, uno de ellos de la misma caracteristica que el denunciado por el transeunte. Atento a ello, es que la Teniente Rampi solicita colaboracion en el lugar, arribando para ello el movil IO 29397, Sgto. Pe√±a, IO29601, Sgto. Rejas Braian y Oficial Mu√±oz Lucas, y movil RO 30174 a cargo de la Subteniente Jurado Magali y Oficial de Policia Veron Noelia, quienes realizan cerrojo por calle Vertiz y por calle San Salvador, mientras la Teniente Rampi junto al Sgto. Acosta ingresan por el pasillo donde se hallaban las motos y dos sujetos masculinos, quienes al percatarse de la presencia policial emprenden fugan ingresando a un domicilio del asentamiento ubicado en el lugar, en este lapso el sujeto individualizado por vestir camisa color verde y blanca, quien se descarta en la entrada del domicilio, un morral color azul. Se continua su persecucion hasta logra la aprehension de ambos sujetos masculinos. Que, al tratarse el lugar de un asentamiento donde los vecinos resultan ser reticentes con el personal policial, y de recibir agresiones a traves de que arrojaban piedrazos entre otros elementos, que entorpecian la labor policial, se procede a cargar los dos motovehiculos, el morral y a introducir a ambos sujetos en el interior del movil policial, trasladando todo ello a la dependencia policial que se encuentra emplazada a 400mts del lugar a fines resguardar la integridad de las personas demoradas y las del personal policial. Una vez en los asientos de Comisaria Decimosexta, se requiere de la presencia de un testigo de actuacion a quien impuesto por las penas con que la ley castiga el falso testimonio presta juramento de ley a producirse con veracidad en todos sus dichos y en todo lo que le fuere preguntado, recayendo tal responsabilidad sobre el ciudadano VILLALBA GUILLERMO HORACIO, argentino, de 45 a√±os de edad, soltero, de ocupacion cocinero, titular del DNI nro. 28.453.876, nacido el 05/11/1980, en Mar del Plata, domiciliado en calle Fitte nro. 2185, de este medio, abonado 223 5802067, delante de quien se procede a realizar un palpado sobre las prendas de ambos sujetos, no hallando elementos de interes, que pudieran atentar contra la integridad fisica propia y de terceros, arrojando resultado negativo, seguidamente se procede a dar lectura de derechos y garantias que por ley lo asisten manifestando ambos masculinos si, haberlos comprendido. Se continua con el secuestro del morral, del cual se  exhibe lo que hay en el interior, tratandose de (66) sesenta y seis envoltorios de nylon color blanco, que en su interior contiene una sustancia blanca, polvorienta, similar al clorhidrato de cocaina. Dinero en efectivo ciento cincuenta mil doscientos cincuenta pesos. Seguidamente, consultan ambos motovehiculos por sistema informatico, a traves del numero de motor 5DH1P50FMH2D5850928, el cual cursado por sistema informatico corresponde a una honda 110cc que posee ‚ÄúPedido de secuestro activo‚Äù con fecha 11/12/2025, de comisaria 13ra., como asi tambien el motovehiculo Gilera Smash color roja y negra con dominio colocado A277JHS, la cual arroja ‚ÄúAdelanto de secuestro activo‚Äù de fecha actual, todo lo mencionado resulta legalmente secuestrado bajo atenta mirada del testigo. Controlada la situacion se procede a identificar a los sujetos, manifestando el individualizado por descartarse el morral azul como: Difino Roman Agustin, argentino, instruido, de 18 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.216.376, nacido el 10/01/2008, de este medio, domiciliado en calle (Vertiz y las vias, pasillo), hijo de Difino Eduardo Javier (v) y Corvalan Sandra Gisel (v), quien resulta ser de contextura fisica delgada, tez trigue√±a, de cabello casta√±o oscuro corto, de 1.80mts de altura, quien viste camiseta a rayas verde y blanco, pantalon negro y zapatillas negras. Mientras el segundo masculino, manifesto ser y llamarse: Bonaventura Luciano Iasaias, argentino, instruido, con fecha de nacimiento 05/10/2006, que no memorizaba su numero de documento de identidad. Seguidamente, en este acto se hace presente una ciudadana manifestando ser familiar del sujeto ‚Äúmenor‚Äù, quien se identifico como Alfonso Silvia Esperanza, aportando un Documento Nacional de Identidad, el cual poseia la foto de un menor de edad, no logrando distinguir con la fotografia si se trataba realmente del encausado que manifestaba ser menor de edad. Al indicarle al masculino que refiriera su fecha de nacimiento nuevamente para cotejar si el DNI se trataba del suyo, este responde como fecha de nacimiento 03/03/2009, dando cuenta que mentia los datos filiatorios. Siendo que a la femenina se le indica que se retire ya que se encontraba acompa√±ada de tres menores, de edades infantes. Al sentirse acorralado por la situacion, el mismo finalmente, refiere ser y llamarse: MONTALIVET LAUTARO EEQUIEL, argentino, instruido, de 17 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.986.197, nacido el 21/10/2008, en Mar del Plata, domiciliado en calle Vertiz, nro. 7631, de este medio, hijo de Montalivet Cesar Ezequiel (V) y Bonaventura Nelida (V), quien resulta ser de contextura fisica delgada, de tez morena, de cabello oscuro corto, de 1.60 mts. de altura, quien viste remera roja, y short de futbol de boca color azul y amarillo, lleva puesto en los pies ojotas blancas. Tras ser consultado por sistema informatico posee CAPTURA ACTIVA, solicitada por el Juzgado del Joven n¬∞1, con fecha 05/09/2025, bajo IPP 020078/25-00. Una vez corroborado que el encausado resulta ser menor de edad, se lo notifica de la formacion de causa asistido por un adulto mayo, la ciudadana Palacios Evelyn Elizabeth, argentina, instruida, de 28 a√±os de edad, soltera, embasadora, titular del DNI nro. 45.131.277, nacida el 16/12/1997, en Mar del Plata, domiciliada en calle Camusso nro. 1699 de este medio, enterandoselo del contenido del ARTICULO 36 DE LA LEY 13.634 cuyo texto reza ‚ÄúEl ni√±o sujeto a proceso penal gozara de todos los derechos y garantias reconocidos a los mayores y en especial tendra derecho a: 1) Ser informado de los motivos de la investigacion y de la autoridad responsable de la misma, del derecho a no declarar contra si mismo y a solicitar la presencia inmediata de sus padres, tutores, responsables y su defensor: 2) No ser interrogado por autoridades policiales, militares, civiles o administrativas: 3) Recibir informacion clara y precisa de todas las autoridades intervinientes del fuero, sobre el significado de cada una de las actuaciones procesales que se desarrollan en su presencia, asi como del contenido y de las razones, incluso etico y sociales de las decisiones, de tal forma que el procedimiento cumpla su funcion educativa: 4) Que la privacion de la libertad sea solo una medida de ultimo recurso y que sea aplicada por el periodo mas breve posible, debiendo cumplirse en instituciones especificas para ni√±os, separadas de las de adulto, a cargo del personal especialmente capacitado, teniendo en cuenta las necesidades de su edad: 5) Comunicarse personalmente con la autoridad judicial, recibir visitas, e intercambiar correspondencia con su familia, al estudio y a la recreacion: 6) Que no se registren antecedentes policiales que perjudiquen su dignidad: 7) Que las decisiones sobre las medidas cautelares salidas alternativas al proceso, y requisitoria de elevacion a juicio, bajo pena de nulidad, se dicten en audiencia oral en su presencia, la de su defensor, acusador y demas intervinientes, conforme a los principios de continuidad, y mediacion, contradiccion y concentracion. Asimismo, se lo notifica del art. 12 de la Convencion del Ni√±o del derecho de ser escuchado. Seguidamente y conforme lo dispone el Art. 60 del CPPBA, se le hace saber que desde el primer momento del inicio de las actuaciones goza de las siguientes garantias minimas: 1) Ser informado sin demora en un idioma que comprenda y en forma detallada de la naturaleza y la causa de los cargos que se le imputan: 2) A comunicarse libremente con un letrado de su eleccion, y que le asiste el derecho de ser asistido y comunicado por el Defensor Oficial: 3) Que no esta obligado a declarar contra si mismo ni a confesarse culpable: 4) Los derechos que le asisten con relacion al responsable civil del hecho por el que se lo imputa si lo hubiere, y tambien respecto del asegurador, en caso de existir contrato, como asi mismo los derechos que lo asisten respecto de requerir al asegurador que asuma su defensa penal. Por ultimo se le notifica del articulo 1 de la LEY 22278, el cual reza: no es punible el menor que no haya cumplido dieciseis a√±os de edad. Tampoco lo es el que no haya cumplido dieciocho a√±os, respecto de delitos de accion privada o reprimidos con pena privativa de la libertad que no exceda de dos a√±os, con multa o con inhabilitacion. Si existiere imputacion contra alguno de ellos la autoridad judicial lo dispondra provisionalmente, procedera a la comprobacion del delito, tomara conocimiento directo del menor, de sus padres, tutor o guardador y ordenara los informes y peritaciones conducentes al estudio de su personalidad y de las condiciones familiares y ambientales en que se encuentre. En caso necesario pondra al menor en lugar adecuado para su mejor estudio durante el tiempo  indispensable. Si de los estudios realizados resultare que el menor se halla abandonado, falto de asistencia, en peligro material o moral, o presenta problemas de conducta, el juez dispondra definitivamente del mismo por auto fundado, previa audiencia de los padres, tutor o guardador. El movil 30504, a cargo de la Teniente Rampi, se dirige junto al testigo de actuacion a realizar a la sede de ‚Äúdrogas‚Äù el reactivo correspondiente a cargo de OSI Lescano Dario, corroborando que al tomar azarosamente el testigo una muestra del secuestro de la sustancia blanca, polvorienta, misma arroja resultado positivo para clorhidrato de cocaina. Al colocar en la balanza la totalidad de envoltorios, misma arroja un pesaje de 11.35gr. La Sargento Espinosa mantiene comunicacion con la Comisaria Duodecima, a fines consultar si habian recibido denuncia de un motovehiculo Gilera, 110cc, confirmando la existencia de la IPP 003635-26/00, efectuada por el ciudadano Montalivet Cesar Ezequiel, argentino, instruido, de 58 a√±os de edad, casado, empleado, titular del DNI nro. 18.674.850, nacido el 06/11/1967, domiciliado en calle Rivadavia nro. 12720, abonado 2236694848, quien manifiesta que se encontraba en su domicilio cuando advierte el ingreso al patio de su casa un motovehiculo 110cc con dos masculinos a bordo, mientras que en la vereda queda otro motovehiculo de 110cc abordado por dos masculinos mas, seguido observa ingresar a su nieto Montalivet Lautaro manipulando un arma de fuego, desconociendo tipo y calibre, con la cual apunta al interior de la vivienda donde se encontraba con su familia. Sustrayendole su motovehiculo marca Gilera modelo Smash 110, modelo 2025, motor nro. AD1P52FMHR0027535, NRO. CHASI 8CXSMASHSRNS70130, color rojo con detalles en negro. A esta altura, habiendo identificado correctamente a los causantes, y ante la intervencion de un menor de edad en el hecho, es que el jefe de turno, Comisario Ortiz Flavio, mantiene comunicacion con el FRPJ 3, a cargo del Sr. Agente Fiscal Dr. Walter Martinez Soto, quien interiorizado de los pormenores dispone se notifique de la formacion de causa por ROBO CALIFICADO POR EL USO DE ARMA DE FUEGO, se notifique a ambos causantes del articulo 60 CPP, se realicen diligencias de rigor, se traslade al menor al CEA, y al mayor a la unidad penal 44. Se remitan actuaciones escaneadas via email. Presentacion del menor a las 08:00hs en el FRPJ. Siendo las 02:00hs, la Sargento Espinosa Anahi, intenta mantener comunicacion con el abonado 2234225537, Juzgado de garantias del Joven 1, a cargo del Dr. Saumell, no logrando obtener respuesta. Siendo las 02:01hs se intenta entablar comunicacion con la Defensoria del Joven 4, De La Plaza, no logrando obtener respuesta. Siendo las 03:28hs, se logra mantener comunicacion con la Defensoria 4, Dr. De La Plaza, quien se interioriza de los pormenores en virtud al menor Montalivet. Cabe destacar que siendo las 02:20hs se traslada al menor Montalivet en el movil 30498 a cargo del Oficial Principal Silva, al CEA, por asi haberlo dispuesto el Sr. Agente Fiscal Dr. Martinez Soto, no siendo recibido por carecer de informe medico. Que, por la franja horaria, se carece de facultativo medico en sede de cuerpo medico de policia. Se traslada al menor al HIGA, informando que no habia medico hasta las 08:00hs. Se comienza a comunicar a los Centros de Primeros Auxilios, a fines corroborar si poseen guardia, encomendando un movil policial, quien entrevistado en el CAPS N¬∞ 2 de calle 12 de Octubre nro. 4445, quienes refieren que acerquemos al menor que realizarian una constancia medica de atencion. Misma es emitida por el Dr. Sandoval Jorgelina, 05:10hs. Se deja constancia que por la hora en la que se logra culminar la diligencia del examen medico legal, el menor Montalivet permanece en el movil RO 30498 a cargo del Oficial Principal Silva, para ser trasladado en breve a la fiscalia requerida. No siendo para mas el acto se da por finalizada la presente la cual es leida, ratificada, y firmada el pie por sus intervinientes para legal constancia. -"                 </div>             </div>         </div>         </div>`)[0];

                var html_1a8b5308ffea5c2747e1ec7bae506915 = $(`<div id="html_1a8b5308ffea5c2747e1ec7bae506915" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>01:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>DELLA PAOLERA  2325</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Fecha, siendo las 09:45hs., denuncia que resulta ser ‚Äúpropietario‚Äù de vehiculo marca ‚ÄúCorven‚Äù, modelo ‚ÄúEnergy 110 by corven‚Äù, dominio sin asignar‚Äù, color ‚ÄúBlaca‚Äù, chasis N¬∞ ‚Äú 8CVXCH2G4SA504615‚Äù, motor N¬∞ ‚ÄúCVSA20A214535‚Äù a√±o de fabricacion 2026, no posee patente ya que el mismo la retira de la concesionaria el dia 10 de enero aproximadamente no recordando fecha exacta en este momento, kilometros realizado 140Km, tanque de combustible 1‚ÅÑ2 aproximadamente. Que en el dia de la fecha, a las 01:20horas aproximadas, dirige desde su trabajo en el complejo parque industrial, hacia su vivienda en calle Avenida Della Paolera 2325, al llegar a calle Avenida Della Paolera llegando a la Avenida Constitucion sobre el lado de la izquierda aparece un motovehiculo el cual no puede dar descripciones con dos masculinos, ellos se le ponen a la par e intentan tirarlo del rodado no lograndolo, en ese instante aparece un segundo moto vehiculo, con dos masculinos los cuales logran desestabilizar al deponente, y hacen que el mismo pierda el equilibrio, una ves que el masculino esta en el piso, uno de los cuatro masculino se acerca al masculino para reducirlo, y en ese momento mientras el deponente se encontraba reducido un segundo masculino toma su moto vehiculo y se dan a la fuga en el y en los otros dos rodados por calle Della Paolera en direccion a Calle Monse√±or Zabala perdiendolos de vista, ya que el lugar se encuentra muy oscuro Preguntado si recuerda alguna caracteristica en particular del motovehiculo, refiere: refiere que estaba de fabrica, sin ningun tipo de da√±o ni cambio realizado. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: que le parece que eran personas jovenes, que no puede recordar vestimentas, solo que no tenian casco colocado si gorras pero que no recuerdas rostros. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: NO, que no pudo ver sus rostros. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: no, que hablaban agresivo pero no escucho nada diferente en su forma de hablar, que por como hablaban debian tener entre 18 y 25a√±os. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, que ellos no hablaron entre si. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: que supone que en calle Della Paolera y consitucion tiene camaras pero que el de igual forma no llego a la avenida. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, dice que posee en este momento solo un juego de llave el cual aporta en este acto, el segundo juego se lo llevaron al momento del robo. Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 140Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que 1/2 tanque aproximado de combustible Nafta. Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que no posee ningun contrato de rastreador. Examinado si posee seguro y que tipo de cobertura posee, responde  que tiene su vehiculo asegurado por Triunfo poliza N¬∞ 481 3.037.838, con cobertura todo riesgo. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que no. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde que desconoce ya que era tarde y los pocos autos que pasaron ninguno paro auxiliarlo. Interrogado si su vehiculo poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, responde que al momento no lo llevo al talle. Examinado si poseia elementos en el interior de su vehiculo que desea aclarar, responde que no tenia nada en el rodado. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que se acerco directamente a la dependencia. Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde que no.. Preguntado si los masculinos tenian arma de fuego, refiere que no vio ninguna, solo que amedrentaban de tener. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No."                 </div>             </div>         </div>         </div>`)[0];
